INSERT INTO `wp_comments` VALUES (1,1,'A WordPress Commenter','wapuu@wordpress.example','https://wordpress.org/','','2020-10-26 22:24:04','2020-10-26 22:24:04','Hi, this is a comment.\nTo get started with moderating, editing, and deleting comments, please visit the Comments screen in the dashboard.\nCommenter avatars come from <a href=\"https://gravatar.com\">Gravatar</a>.',0,'1','','comment',0,0),(2,71,'Cobus Bester','bester.c@gmail.com','','196.215.9.147','2013-06-07 11:57:05','2013-06-07 11:57:05','Simple and effective design. One of my favorites.',0,'1','','comment',0,0),(3,72,'Cobus Bester','bester.c@gmail.com','','196.215.9.147','2013-06-07 11:53:49','2013-06-07 11:53:49','Wonderful quality, and an awesome design. WooThemes ftw!',0,'1','','comment',0,0),(4,72,'Andrew','andrew@chromeorange.co.uk','','86.19.152.140','2013-06-07 11:57:45','2013-06-07 11:57:45','This t-shirt is awesome! Would recommend to everyone!\n\nI\'m ordering mine next week',0,'1','','comment',0,0),(5,73,'James Koster','james@jameskoster.co.uk','','86.146.141.82','2013-06-07 11:43:13','2013-06-07 11:43:13','Nice T-shirt, I got one in black. Goes with anything!',0,'1','','comment',0,0),(6,73,'Cobus Bester','bester.c@gmail.com','','196.215.9.147','2013-06-07 11:55:15','2013-06-07 11:55:15','Very comfortable shirt, and I love the graphic!',0,'1','','comment',0,0),(7,73,'Stuart','stuart@woothemes.com','','82.32.109.140','2013-06-07 13:02:14','2013-06-07 13:02:14','Great T-shirt quality, Great Design and Great Service.',0,'1','','comment',0,0),(8,74,'Cobus Bester','bester.c@gmail.com','','196.215.9.147','2013-06-07 11:54:32','2013-06-07 11:54:32','The ninja silhouette is one of my favorite designs. This is a great product.',0,'1','','comment',0,0),(9,76,'Stuart','stuart@woothemes.com','','82.32.109.140','2013-06-07 13:01:25','2013-06-07 13:01:25','This will go great with my Hoodie that I ordered a few weeks ago.',0,'1','','comment',0,0),(10,76,'Maria','maria@woothemes.com','','24.225.103.32','2013-06-07 15:49:53','2013-06-07 15:49:53','Love this shirt! The ninja near and dear to my heart. &lt;3',0,'1','','comment',0,0),(11,77,'Stuart','stuart@woothemes.com','','82.32.109.140','2013-06-07 13:03:29','2013-06-07 13:03:29','Another great quality product that anyone who see\'s me wearing has asked where to purchase one of their own.',0,'1','','comment',0,0),(12,77,'Ryan','ryan@woothemes.com','','99.153.225.252','2013-06-07 13:24:52','2013-06-07 13:24:52','This hoodie gets me lots of looks while out in public, I got the blue one and it\'s awesome. Not sure if people are looking at my hoodie only, or also at my rocking bod.',0,'1','','comment',0,0),(13,77,'Maria','maria@woothemes.com','','24.225.103.32','2013-06-07 15:53:31','2013-06-07 15:53:31','Ship it!',0,'1','','comment',0,0),(14,78,'Cobus Bester','bester.c@gmail.com','','196.215.9.147','2013-06-07 11:57:59','2013-06-07 11:57:59','This hoodie is great for those chilly winter days. I love the WooNinja!',0,'1','','comment',0,0),(15,78,'Maria','maria@woothemes.com','','24.225.103.32','2013-06-07 15:53:13','2013-06-07 15:53:13','Perfect for the lady Ninja in your life!',0,'1','','comment',0,0),(16,79,'James Koster','james@jameskoster.co.uk','','86.146.141.82','2013-06-07 11:46:52','2013-06-07 11:46:52','Perfect when you\'re sat at your computer, waiting for the next batch of Woo Goodies to be released. The Patient Ninja is Patient.',0,'1','','comment',0,0),(17,79,'Cobus Bester','bester.c@gmail.com','','196.215.9.147','2013-06-07 11:53:13','2013-06-07 11:53:13','The most comfortable hoodie I have ever owned!',0,'1','','comment',0,0),(18,79,'Magnus','magnus@woothemes.com','','79.161.106.35','2013-06-07 12:04:03','2013-06-07 12:04:03','This is my favorite hoodie!\n\nIf only it came in red as well!',0,'1','','comment',0,0),(19,80,'Andrew','andrew@chromeorange.co.uk','','86.19.152.140','2013-06-07 11:54:51','2013-06-07 11:54:51','I bought this thinking it was a nice green color, apparently it GREY! I\'m color blind so I don\'t care but my girlfriend says grey makes me look fat',0,'1','','comment',0,0),(20,80,'Maria','maria@woothemes.com','','24.225.103.32','2013-06-07 15:50:22','2013-06-07 15:50:22','I love grey hoodies! This is perfect with my grey Ninja shirt, when I get cold I throw this on and I can still be a Ninja.',0,'1','','comment',0,0),(21,81,'student','student@woothemes.com','','196.215.9.147','2013-06-07 12:14:53','2013-06-07 12:14:53','Perfect Hoodie for a Ninja!',0,'1','','comment',0,0),(22,81,'Coen Jacobs','coen@woothemes.com','','84.39.28.254','2013-06-07 12:20:56','2013-06-07 12:20:56','I have lots of hoodies, but none is as cool as this one!',0,'1','','comment',0,0),(23,81,'Dan','dan@woothemes.com','','188.221.1.167','2013-06-07 12:41:42','2013-06-07 12:41:42','I love hoodies, and ninjas, so what could be better than a ninja hoodie? Not much, if you ask me!',0,'1','','comment',0,0),(24,81,'Ryan','ryan@woothemes.com','','99.153.225.252','2013-06-07 13:26:40','2013-06-07 13:26:40','This is the most bombastic hoodie in this shop, it\'s soft and has the sly WooThemes ninja on it. Why wouldn\'t you buy this?',0,'1','','comment',0,0),(25,81,'Maria','maria@woothemes.com','','24.225.103.32','2013-06-07 15:53:56','2013-06-07 15:53:56','This only gets 1 star because I don\'t have this yet. I want it now!',0,'1','','comment',0,0),(26,81,'Gerhard','gerhard@woothemes.com','','72.251.244.9','2013-06-08 09:37:42','2013-06-08 09:37:42','The best hoodie ever!',0,'0','','comment',0,0),(27,82,'Magnus','magnus@woothemes.com','','79.161.106.35','2013-06-07 12:04:33','2013-06-07 12:04:33','I like the logo but not the color.',0,'1','','comment',0,0),(28,82,'Maria','maria@woothemes.com','','24.225.103.32','2013-06-07 15:54:25','2013-06-07 15:54:25','Three letters, one word: WOO!',0,'1','','comment',0,0),(29,84,'Cobus Bester','bester.c@gmail.com','','196.215.9.147','2013-06-07 11:52:25','2013-06-07 11:52:25','Really happy with this print. The colors are great, and the paper quality is good too.',0,'1','','comment',0,0),(30,84,'Andrew','andrew@chromeorange.co.uk','','86.19.152.140','2013-06-07 11:56:36','2013-06-07 11:56:36','You only get the picture, not the person holding it, something they don\'t mention in the description, now I\'ve got to find my own person',0,'1','','comment',0,0),(31,84,'Coen Jacobs','coen@woothemes.com','','84.39.28.254','2013-06-07 12:19:25','2013-06-07 12:19:25','This is my favorite poster. In fact, I\'ve ordered 5 of them!',0,'1','','comment',0,0),(32,84,'Stuart','stuart@woothemes.com','','82.32.109.140','2013-06-07 12:59:49','2013-06-07 12:59:49','This is a fantastic quality print and is happily hanging framed on my wall now.',0,'1','','comment',0,0),(33,85,'Dan','dan@woothemes.com','','188.221.1.167','2013-06-07 12:39:04','2013-06-07 12:39:04','I thought I was buying a man holding a poster, but when it arrived it was just the poster. Cool poster though, so I\'ll give it 3 stars!',0,'1','','comment',0,0),(34,85,'Maria','maria@woothemes.com','','24.225.103.32','2013-06-07 15:55:29','2013-06-07 15:55:29','I didn\'t expect this poster to arrive folded. Now there are lines on the poster and one sad Ninja.',0,'1','','comment',0,0),(35,86,'Maria','maria@woothemes.com','','24.225.103.32','2013-06-07 15:56:24','2013-06-07 15:56:24','He really is the cutest little man. Swoooon!',0,'1','','comment',0,0),(36,93,'Cobus Bester','bester.c@gmail.com','','196.215.9.147','2013-06-07 11:56:32','2013-06-07 11:56:32','Wonderful collection of WooThemes classics! A must buy for all Woo fans.',0,'1','','comment',0,0),(37,94,'Coen Jacobs','coen@woothemes.com','','84.39.28.254','2013-06-07 12:22:07','2013-06-07 12:22:07','This album gets a bit boring after you\'ve listened to it more than once. Worth that first listen though.',0,'1','','comment',0,0),(38,96,'James Koster','james@jameskoster.co.uk','','86.146.141.82','2013-06-07 11:44:50','2013-06-07 11:44:50','The most influential album of the last 25 years? This just might be it.',0,'1','','comment',0,0),(39,96,'Coen Jacobs','coen@woothemes.com','','84.39.28.254','2013-06-07 12:21:30','2013-06-07 12:21:30','Some rad tunes on this album!',0,'1','','comment',0,0),(40,99,'Cobus Bester','bester.c@gmail.com','','196.215.9.147','2013-06-07 11:58:43','2013-06-07 11:58:43','This album proves why The Woo are the best band ever. Best music ever!',0,'1','','comment',0,0),(41,99,'Maria','maria@woothemes.com','','24.225.103.32','2013-06-07 15:52:48','2013-06-07 15:52:48','Can’t wait to start mixin’ with this one! Irba-irr-Up-up-up-up-date your theme!',0,'1','','comment',0,0),(42,144,'WooCommerce','','','','2020-11-04 11:25:05','2020-11-04 11:25:05','Payment to be made upon delivery. Order status changed from Pending payment to On hold.',0,'1','WooCommerce','order_note',0,0),(43,151,'admin','masumbillah546@gmail.com','http://localhost/junno3','::1','2020-11-06 23:23:01','2020-11-06 23:23:01','ryreyeyrey',0,'trash','Mozilla/5.0 (Windows NT 6.1; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/86.0.4240.183 Safari/537.36','comment',0,1);
